import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      Learning React
      <div className="main-container">
      	<div className="img-container">
      	</div>
      	<div className="details-container">
      		<h2>
      			Repository Name
      		</h2>
      		<div className="owner-name">Owner</div>
      		<div className="owner-name">Fork Count</div>
			<div className="owner-name">Star Count</div>      		
      	</div>
      </div>
    </div>
  );
}

export default App;
